import "./coffeList.scss";
import Coffe1 from "../img/coffe-1.png";


const CoffeList = ({index,clickEvent}) =>{


    return(


       <ul className="coffe-list">

            <li onClick={(e)=>{clickEvent(0);}}><figure><img src={Coffe1}/></figure></li>
            <li onClick={(e)=>{clickEvent(1);}}><figure><img src={Coffe1}/></figure></li>
            <li onClick={(e)=>{clickEvent(2);}}><figure><img src={Coffe1}/></figure></li>

       </ul>


    )

}

export default CoffeList;
